import React from "react";

const Footer = () => {
  return (
    <footer
      style={{
        backgroundColor: "#212529",
        color: "white",
        padding: "1rem",
        textAlign: "center",
        marginTop: "auto",
      }}
    >
      <p>© 2023 맞춤형 교정 시스템 | 서울경제신문</p>
    </footer>
  );
};

export default Footer;
